import FormMonth from "../Components/HomePageComponents/FormMonth"

export default function HomePage(){
    const {user, setAuth} = useContext(UserContext);
    useEffect(() => {
        let auth = sessionStorage.getItem("auth");
        if(auth == true){
            setAuth(true)
        }
    })
    
    return(
            <FormMonth/>
    )
}
